
cc.game.onStart = function () {
    if (!cc.sys.isNative && document.getElementById("cocosLoading"))
        document.body.removeChild(document.getElementById("cocosLoading"));

    cc.view.enableRetina(true);
    cc.view.adjustViewPort(true);
    cc.view.setOrientation(cc.ORIENTATION_LANDSCAPE);
    cc.view.setDesignResolutionSize(1280, 720, cc.ResolutionPolicy.SHOW_ALL);
    cc.view.resizeWithBrowserSize(true);
    cc.director.setClearColor(cc.color('#890802'));

    var Config = {
        GAME_ID: 494,
        isOnline: false,
        loginAccount: null,
        loginOptions: {
            socketType: KingSocketType.WS
        },
        isL7: false,            
        useIcon88Chip: false,
        useTestAccount: false
    };

    var game = new SlotPharaoh(Config);
    var commander = game.commander;

    var PRELOAD_ICON = "";
    if (Config.useIcon88Chip) {
        PRELOAD_ICON = "data:image/png;base64,";
    }
    else {
        PRELOAD_ICON = "data:image/png;base64,";
    }

    var PreloadScene = cc.Scene.extend({

        ctor: function (resources, callback) {
            this._super();

            this.commander = commander;
            this.resources = resources;
            this.callback = callback;
        },

        onEnter: function () {
            this._super();

            this.text = new cc.LabelTTF("0", "Arial", 36);
            this.text.setAnchorPoint(cc.p(0.5, 0.5));
            this.text.setPosition(cc.p(cc.visibleRect.center.x, cc.visibleRect.center.y));
            this.addChild(this.text);

            cc.loader.loadImg(PRELOAD_ICON, { isCrossOrigin: false }, this.handleIconDone.bind(this));
            cc.loader.load(this.resources, this.handleResourcesProgress.bind(this), this.handleResourcesDone.bind(this));

            this.commandSession = this.commander.createSession();
            this.commandSession.on("game.loading.updatePercent", this.updatePercent.bind(this));
        },

        onExit: function () {
            this._super();

            if (this.commandSession) {
                this.commandSession.dispose();
                this.commandSession = null;
            }
        },

        updatePercent: function (percent) {

            if (this.text)
                this.text.setString(cc.formatStr("%d%", Math.trunc(percent || 0)));
        },

        handleIconDone: function (error, image) {
            if (!this)
                return;

            var icon = ccui.helper._createSpriteFromBase64(PRELOAD_ICON, "/icon.png");
            icon.setAnchorPoint(cc.p(0.5, 0.5));
            icon.setPosition(cc.p(cc.visibleRect.center.x, cc.visibleRect.center.y + this.text.height));
            this.addChild(icon);

            this.text.setPositionY(icon.y - icon.height / 2 - this.text.height);
        },

        handleResourcesProgress: function (name, index, total) {
        },

        handleResourcesDone: function () {
            this.callback && this.callback();
        }
    });

    PreloadScene.preload = function (resources, callback) {
        var scene = new PreloadScene(resources, callback);
        cc.director.runScene(scene);

        return scene;
    };

    var preloads = Config.isOnline || Config.useTestAccount ? [] : g_resources;

    PreloadScene.preload(preloads, function () {


        if (Config.isOnline) {

            WebHelper._setWebConfig();
            Config.loginAccount = WebHelper._parseConfigAccount();

            game.start();

            return;
        }

        if (Config.useTestAccount) {
            
            var account = {
                userId: "51275",
                userName: "lelelele001",
                userEmail: "lelelele001@abc.net",
                userPass: "12-0D-1B-68-A0-99-F9-62-CD-69-87-AC-07-88-A2-EE-C3-71-E1-8E"
            };

            var options = {};
            options.host = options.host || "192.168.1.245";
            options.port = options.port || 20303;

            Config.loginAccount = account;
            Config.loginOptions = options;

            Config.loginOptions.isPrivate = false;

            game.start();

            return;
        }

        var callback = function (account, options) {

            options.host = options.host || "192.168.1.245";
            options.port = options.port || 20303;

            Config.loginAccount = account;
            Config.loginOptions = options;
            Config.loginOptions.isPrivate = false;

            game.start();
        };

        portalHelper.runGameScene(new PharaohLoginScene(callback, callback));

    }, this);

};

cc.game.run();
